import React from "react";

export const TypesOfAtt = ({name}) => {
  console.log("typeOfAtt");
  return (
    <div className="bg-primary">
      <label htmlFor="">typeOfAtt</label>
      <FastField name={name} type/>
    </div>
  );
};
